import React from 'react'
import useFormContext from '../../Hooks/useFormContext'
import FormFields from './FormFields'

function RegistrationForm() {
  const {
    step,
    setStep,
    userData,
    stepTitle,
    canSubmit,
    disabledNext, disabledPrev, hideNext, hideSubmit
  } = useFormContext()

  const handlePrev = () => setStep(prev => prev - 1)

  const handleNext = () => setStep(prev => prev + 1)

  const handleSubmit = e => {
    e.preventDefault()
    console.log(JSON.stringify(userData))
  }

  return (
    <form
      className="w-[60vw] mx-auto"
      onSubmit={handleSubmit}>

      <header
        className='text-2xl'>
        {stepTitle[step]}
      </header>

      <FormFields />

      <div>
        <button type='button' onClick={handlePrev} disabled={disabledPrev} hidden={disabledPrev}
          className="disabled:text-gray-300 bg-gray-100 py-4 px-6 rounded-md"
        >Previous</button>
        <button type='button' onClick={handleNext} disabled={disabledNext} hidden={hideNext}
          className="disabled:text-gray-300 bg-gray-100 py-4 px-6 rounded-md"
        >Next</button>
        <button type='submit' disabled={!canSubmit} hidden={hideSubmit}
          className="disabled:text-gray-300 bg-gray-100 py-4 px-6 rounded-md"
        >Register</button>
      </div>

    </form>
  )
}

export default RegistrationForm
